<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">

    <title>Navbar</title>
    <script src="https://kit.fontawesome.com/9a8ea11888.js" crossorigin="anonymous"></script>
</head>

<style>
    body {
        background-image: linear-gradient(rgba(0, 0, 0, 0.4), rgba(0, 0, 0, 0.4)), url(./Logo.jpg);
        background-repeat: no-repeat;
        background-size: cover;
        color: #fff;
    }

    * {
        box-sizing: border-box;
        margin: 0px;
        padding: 0px;
    }

</style>

<body>
    <div class="navbar">
        <table>
            <tr>
                <td width="400px">
                    <img src="./Company logo.jpg" class="logo">
                </td>
                <td width="200px">
                    <i class="fa-solid fa-house fa-bounce " style="--fa-animation-duration: 3s;"></i><a href="#"> Home</a>
                   

                </td>
                <td width="200px">
                    <i class="fa-solid fa-box-open fa-bounce" style="--fa-animation-duration: 3s;"></i> <a

                </td>
                <td width="200px">
                    <i class="fa-solid fa-clipboard-list fa-bounce" style="--fa-animation-duration: 3s;"></i>

                </td>
                <td width="200px">
                    <i class="fa-solid fa-user fa-bounce" style="--fa-animation-duration: 3s;"></i> <a href="#">About Us</a>
                   
                </td>
                <td width="200px">
                    <i class="fa-solid fa-envelope fa-bounce" style="--fa-animation-duration: 3s;"></i>

                    <a href="#">Contact Us</a>
                </td>

            </tr>
        </table>
    </div>
